// 增加 split 参数
fms.namespace = function (name, holder, split) {
    var o, j, p
    var split = split || '.'
    if (typeof name === 'object') {
        p = name
    }
    else {
        p = name.split(split)
    }
    var o = holder
    for (j = 0; j < p.length; ++j) {
        o = o[p[j]] = o[p[j]] || {}
    }
    return o
}

